В CSS значение `infinity` используется для определения бесконечной величины размера или времени в свойствах, таких как `animation-duration` или `transition-duration`.
Например, если вы хотите создать анимацию, которая будет продолжаться вечно, вы можете задать значение `infinity` для `animation-duration`. Ниже приведен пример использования:

```css
@keyframes example {
 from { opacity: 0; }
 to { opacity: 1; }
}
.element {
 animation: example 3s infinite; /* Анимация будет повторяться бесконечно */
}
```
